import React, { useState, useEffect } from "react";
import { Navbar, Nav, Container, Button,} from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

const Header = () => {
  const [showDropdown, setShowDropdown] = useState(false);
  const [isMobile, setIsMobile] = useState(false);

  useEffect(() => {
    const updateScreenSize = () => {
      setIsMobile(window.innerWidth < 992);
    };

    updateScreenSize();
    window.addEventListener("resize", updateScreenSize);
    return () => window.removeEventListener("resize", updateScreenSize);
  }, []);

  const handleDropdownToggle = () => {
    if (isMobile) {
      setShowDropdown(!showDropdown);
    }
  };

  const handleMouseEnter = () => {
    if (!isMobile) setShowDropdown(true);
  };

  const handleMouseLeave = () => {
    if (!isMobile) setShowDropdown(false);
  };

  return (
    <div onMouseLeave={handleMouseLeave}>
      <Navbar expand="lg" style={{ backgroundColor: "transparent"}} sticky="top" position="fixed" className="py-4">
        <Container>
          <Navbar.Brand href="/">
            <img src="/logo.png" alt="Churchgate Logo" height="30" />
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="navbar-nav" />
          <Navbar.Collapse id="navbar-nav">
            <Nav className="mx-auto gap-3" onMouseLeave={handleMouseLeave}>
              <Nav.Link href="#about" className="fw-medium fs-3">About Us</Nav.Link>

              <div
                className="position-relative"
                onMouseEnter={handleMouseEnter}
                onClick={handleDropdownToggle}
              >
                <Nav.Link href="#portfolio" className="fw-medium fs-3">Portfolio</Nav.Link>
                {showDropdown && (
                  <div
                    style={{
                      position: "absolute",
                      top: "110%", // slight spacing downward
                      left: "50%",
                      transform: "translateX(-50%)",
                      background: "rgba(255, 255, 255, 0.97)",
                      padding: "3rem",
                      boxShadow: "0px 4px 15px rgba(0, 0, 0, 0.1)",
                      display: "flex",
                      flexDirection: "column",
                      minWidth: "370px",
                      borderRadius: "4px",
                      zIndex: 999,
                    }}
                  >
                    <a href="#wtc" className="text-decoration-none text-dark pb-4 fs-4">World Trade Center, Abuja</a>
                    <a href="#tower1" className="text-decoration-none text-dark py-4 fs-4">Churchgate Tower 1</a>
                    <a href="#tower2" className="text-decoration-none text-dark py-4 fs-4">Churchgate Tower 2</a>
                    <a href="#plaza" className="text-decoration-none text-dark py-4 fs-4">Churchgate Plaza</a>
                    <a href="#warehouses" className="text-decoration-none text-dark py-4 fs-4">Warehouses</a>
                    <a href="#terrace" className="text-decoration-none text-dark pt-4 fs-4">The Ocean Terrace</a>
                  </div>
                )}
              </div>

              <Nav.Link href="#why-choose-us" className="fw-medium fs-3">Why Choose Us</Nav.Link>
              <Nav.Link href="#blog" className="fw-medium fs-3">Blog</Nav.Link>
              <Nav.Link href="#contact" className="fw-medium fs-3">Contact Us</Nav.Link>
            </Nav>

            {/* Hide button on small screens */}
            <div className="d-none d-lg-block">
              <Button
                variant="outline-secondary"
                className="fw-medium fs-4 p-3"
                style={{
                  borderRadius: "0.25rem",
                  border: "1px solid #999",
                  color: "#000",
                }}
              >
                Book An Appointment
              </Button>
            </div>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
};

export default Header;
